// Classic Roblox Discord Theme - Sound System
const RobloxTheme = {
  sounds: {
    messageSent: new Audio(),
    messageReceived: new Audio(),
    buttonClick: new Audio(),
    robloxOof: new Audio(),
    robloxTeleport: new Audio(),
    robloxWalk: new Audio()
  },

  init: function() {
    // Load sound effects (you'll need to replace these with actual Roblox sounds)
    this.sounds.messageSent.src = 'data:audio/wav;base64,UklGRnoGAABXQVZFZm10IBAAAAABAAEAQB8AAEAfAAABAAgAZGF0YQoGAACBhYqFbF1fdJivrJBhNjVgodDbq2EcBj+a2/LDciUFLIHO8tiJNwgZaLvt559NEAxQp+PwtmMcBjiR1/LMeSwFJHfH8N2QQAoUXrTp66hVFApGn+DyvmEhAjF+zPLPdCYGH3nK8N2RSAwTX7zp5qVTFAhGn+DVbmsmAjR+yPLNeyAAAABvdXRwdXQgdG9vIG1hbnkgYnl0ZXM=';

    // Set volume for all sounds
    Object.values(this.sounds).forEach(sound => {
      sound.volume = 0.3;
    });

    this.setupMessageSounds();
    this.setupButtonSounds();
    this.setupClassicElements();
    this.addRobloxLogo();
    this.setupAnimations();
  },

  setupMessageSounds: function() {
    // Play sound when sending messages
    const observer = new MutationObserver(mutations => {
      mutations.forEach(mutation => {
        mutation.addedNodes.forEach(node => {
          if (node.classList && node.classList.contains('message-2CShn3')) {
            this.sounds.messageSent.currentTime = 0;
            this.sounds.messageSent.play().catch(e => console.log('Sound play failed:', e));
          }
        });
      });
    });

    const chatContent = document.querySelector('.chatContent-3KubbW');
    if (chatContent) {
      observer.observe(chatContent, { childList: true, subtree: true });
    }
  },

  setupButtonSounds: function() {
    document.addEventListener('click', (e) => {
      if (e.target.classList.contains('button-f2h6uQ') || e.target.closest('.button-f2h6uQ')) {
        this.sounds.buttonClick.currentTime = 0;
        this.sounds.buttonClick.play().catch(e => console.log('Sound play failed:', e));
      }
    });
  },

  setupClassicElements: function() {
    // Add classic Roblox styling to messages
    const style = document.createElement('style');
    style.textContent = `
      .message-2CShn3 .username-h_Y3Us {
        color: var(--robloxBlue) !important;
        font-weight: 700 !important;
        text-shadow: 1px 1px 2px rgba(0,0,0,0.1) !important;
      }

      .message-2CShn3 .timestamp-p1Df1m {
        color: var(--textMuted) !important;
        font-size: 11px !important;
        font-weight: 500 !important;
      }

      .textArea-2CLwUE {
        font-family: 'Source Sans Pro', monospace !important;
        font-size: 14px !important;
      }

      /* Classic Roblox chat bubble effect */
      .message-2CShn3::after {
        content: '';
        position: absolute;
        bottom: -8px;
        left: 20px;
        width: 0;
        height: 0;
        border-left: 8px solid transparent;
        border-right: 8px solid transparent;
        border-top: 8px solid var(--backgroundSecondary);
      }

      /* Add classic Roblox glow effect to interactive elements */
      .channel-1Shao0:hover,
      .button-f2h6uQ:hover {
        box-shadow: 0 0 15px rgba(0, 162, 232, 0.4) !important;
      }

      /* Classic scrollbar */
      ::-webkit-scrollbar {
        width: 12px;
        background: var(--backgroundSecondary);
      }

      ::-webkit-scrollbar-thumb {
        background: var(--roblox-gradient);
        border-radius: 6px;
        border: 2px solid var(--backgroundSecondary);
      }

      ::-webkit-scrollbar-thumb:hover {
        background: var(--interactiveHover);
      }
    `;
    document.head.appendChild(style);
  },

  addRobloxLogo: function() {
    // Add classic Roblox logo to top bar
    const titleBar = document.querySelector('.titleBar-1it3bQ');
    if (titleBar) {
      const logo = document.createElement('div');
      logo.innerHTML = ' ROBLOX Classic Theme 2017 ';
      logo.style.cssText = `
        position: absolute;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
        color: white;
        font-weight: bold;
        font-size: 14px;
        text-shadow: 2px 2px 4px rgba(0,0,0,0.3);
        pointer-events: none;
      `;
      titleBar.appendChild(logo);
    }
  },

  setupAnimations: function() {
    // Add entrance animations to messages
    const style = document.createElement('style');
    style.textContent = `
      @keyframes robloxMessageAppear {
        0% {
          opacity: 0;
          transform: translateX(-30px) scale(0.95);
        }
        50% {
          opacity: 0.7;
          transform: translateX(-10px) scale(1.02);
        }
        100% {
          opacity: 1;
          transform: translateX(0) scale(1);
        }
      }

      .message-2CShn3 {
        animation: robloxMessageAppear 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275) !important;
      }

      @keyframes robloxPulse {
        0% { box-shadow: 0 0 0 0 rgba(0, 162, 232, 0.7); }
        70% { box-shadow: 0 0 0 10px rgba(0, 162, 232, 0); }
        100% { box-shadow: 0 0 0 0 rgba(0, 162, 232, 0); }
      }

      .channel-1Shao0.selected-3veCBZ {
        animation: robloxPulse 2s infinite !important;
      }
    `;
    document.head.appendChild(style);
  }
};

// Initialize when DOM is ready
if (document.readyState === 'loading') {
  document.addEventListener('DOMContentLoaded', () => RobloxTheme.init());
} else {
  RobloxTheme.init();
}

// Re-initialize when Discord updates
setInterval(() => {
  if (!document.querySelector('.roblox-theme-initialized')) {
    const marker = document.createElement('div');
    marker.className = 'roblox-theme-initialized';
    marker.style.display = 'none';
    document.body.appendChild(marker);
    RobloxTheme.init();
  }
}, 2000);
